var tipuesearch = {"pages": [{'title': 'About', 'text': '\n 兩人小組:40823247、 40823248 \n 小組倉儲: https://github.com/40823247/stage1-bg21 \n 小組網頁: https://40823247.github.io/stage1-bg21/content/index.html \n', 'tags': '', 'url': 'About.html'}, {'title': 'Stage1全自動旋轉烤肉機', 'text': '', 'tags': '', 'url': 'Stage1全自動旋轉烤肉機.html'}, {'title': 'W1', 'text': '架設網站、下載SHAREX、錄製影片。 \n', 'tags': '', 'url': 'W1.html'}, {'title': 'W2', 'text': '選定小組題目，題目為自動旋轉烤肉機。 \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '組員開始繪製小組題目，討論設計的方向。 \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '利用coppeliasim模擬全自動旋轉烤肉機運作方式。 \n stage1bg21 \n', 'tags': '', 'url': 'W4.html'}, {'title': 'Stage2多功能腳踏車衝擊測試機', 'text': '\n', 'tags': '', 'url': 'Stage2多功能腳踏車衝擊測試機.html'}, {'title': 'W5', 'text': '日期:2021/3/26 \n 時間:協同產品設計實習課程中 \n 事件:當時老師出給大家一個挑戰，讓大家透過python寫出一個程式，透過這個程式，批量修改mp4檔的檔案名稱，以及顯示mp4檔案的長度。 \n 回家後開始研究了一些資料，發現有python裡面，有OS模塊中的指令能做到的到。 \n 參考資料: \n python批量修改文件名 \n python批量讀取資料夾檔案、修改檔案 \n 日期:2021/3/27 \n 研究了一個多小時，發現還是不太懂，但至少知道兩個參考資料的區別在哪，之後會再做研究，下面這張圖是我用白窗研究python修改檔名，跟讀取檔案指令的程式。 \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '\n 決定小組題目為:多功能腳踏車衝擊測試機 \n 4人小組組員:40823214、40823225、40823247、40823248 \n 分工: \n 繪圖:40823214 \n 網站管理:40823225 \n 程式模擬:40823247、40823248 \n 參考資料: 台灣自行車產業標準 \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '此時仍在繪製段，繪製半成品如下 \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '程式模擬 \n 此為程式模擬影片，使用coppeliasim時模擬出現問題，仍在找詳細原因 \n 目前改用invertor模擬，以下為模擬影片。 \n 1.輪胎衝擊測試模擬測試 \n \n 2.腳踏車架衝擊模擬測試 \n \n 3.腳踏車前叉衝擊模擬測試 \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '本週為期中報告週，stage2也到了尾聲，與stge1的自動旋轉烤肉機相比，這次我們挑戰了更高難度的作品，多功能腳踏車衝擊測試機。以下是W9的主題總結影片。 \n \n', 'tags': '', 'url': 'W9.html'}, {'title': 'Team', 'text': 'stage1小組題目，本設計自動旋轉烤肉機。 \n', 'tags': '', 'url': 'Team.html'}, {'title': '自動旋轉烤肉機', 'text': '製作動機為，因為想要縮短烤肉的時間，並增加烤肉的便利性，所以採用這個題目。 \n 參考: 【全自動】旋轉串燒烤肉機！ \n 經討論決定分工項目後，由我來管理小組網頁，以及coppeliasim的程式模擬，而另一個組員負責繪製零件。 \n', 'tags': '', 'url': '自動旋轉烤肉機.html'}, {'title': 'Mission', 'text': '\n 請在各組組長的 Github 帳號下建立各組的分組網站, 惟在 W1 進行各班定組序過程中, 發現即便採用 Ethercalc 以網際協同方式同步讓各班自選組員填入兩兩成組的學員學號, 但仍缺人工或自動定各班組序的有效方案, 在此責成各組在進行自選的協同產品開發項目之際 (W2-W4), 將此議題列為必選的題目之一, 詳細說明各組認為最有效率的第一階段與訂定組序的方法及流程。 \n 此外, 為了讓各組在 stage1 分組協同實習過程, 能透過網誌發表各組組員在 W2-W4 過程中的各項作為與心得報告, 說明可利用 Leo Editor 協助 CMSiMDE 中的 Pelican 發表協同網誌, 其目的是讓各分組在協同期間, 能完整呈現各階段所留下的網誌紀錄. 但此方式必須熟悉 Leo Editor 的操作, 因此有關透過 Pelican 建立協同網誌一事, 除利用 Leo Editor 協助設定並建立 pelican 網誌外, 也將此議題列為各組在 Stage1 協同產品設計流程中必選題目之二, 請各組詳細說明採用或不採用 Leo Editor 的兩種情況下, 各組員在設定與建立協同網誌的過程所可能遭遇或產生的問題與解決方案。 \n \n', 'tags': '', 'url': 'Mission.html'}, {'title': 'Others', 'text': '', 'tags': '', 'url': 'Others.html'}, {'title': 'Fix cmsimde', 'text': '1.進入 https://github.com/mdecourse/cmsimde \n 2.點commits \n \n 3.找到最新版本，點旁邊那串 \n \n 4.把網址後面那串複製下來 \n \n 5.進小黑窗，到cmsimde，輸入git checkout 把剛剛那串貼上，按ENTER \n \n 6.回到cd2021，PUSH一次 \n', 'tags': '', 'url': 'Fix cmsimde.html'}, {'title': 'Update cmsimde', 'text': '1.打開黑窗，進入cmsimde \n 2.輸入git pull origin master，按enter \n \n 3.打開資料夾>cd2021>cmsimde>up_dir \n 4.複製acp.bat、cms.bat、http-server.py、localhost.crt、localhost.key \n 5.回到cd2021，貼上，系統會問你要不要取代http-server.py，按取代檔案 \n \n 用完之後，以後想要打開遠端，只需要進到cd2021，輸入cms即可。 \n 要推送的話，則是進到cd2021，輸入acp "上傳標題"即可。 \n', 'tags': '', 'url': 'Update cmsimde.html'}, {'title': 'leo', 'text': '-打開blog、reveal簡報檔案- \n 1.打開leo \n 2.點選file>open-outline \n \n 3.點選pelican就是打開blog檔案，點選reveal就是簡報檔案。 \n \n 編輯leo小技巧 \n 新增分目錄:點一下主目錄，按ctrl+i。 \n 將同排的目錄變成分目錄:點一下要動的目錄，按ctrl+r。 \n \n', 'tags': '', 'url': 'leo.html'}, {'title': 'Videos', 'text': '1.介紹創立本網站的目的，以及網站內容。 \n \n 2.小組主題報告影片，內容是小組的設計成果。 \n \n 3.w5研究python指令的影片，此影片沒有聲音，拍此影片的目的是紀錄我的學習過程。 \n', 'tags': '', 'url': 'Videos.html'}]};